import React from 'react';

// import recharts
import {
    LineChart, Line, XAxis, YAxis, CartesianGrid, Tooltip, Legend,
} from 'recharts';

// import material ui core 
import { makeStyles } from '@material-ui/core/styles';
import Paper from '@material-ui/core/Paper';

import styles from '../../assets/styles/components/dashgraphStyle.js';

const useStyles = makeStyles(styles);

export default function DashGraph(props) {

    const classes = useStyles();

    const titleCase = (str) => {
        var splitStr = str.toLowerCase().split(' ');
        for (var i = 0; i < splitStr.length; i++) {
            splitStr[i] = splitStr[i].charAt(0).toUpperCase() + splitStr[i].substring(1);
        }
        return splitStr.join(' ');
    }
    const data = [
        {name: 'Page A', uv: 4000, pv: 2400, amt: 2400},
        {name: 'Page B', uv: 3000, pv: 1398, amt: 2210},
        {name: 'Page C', uv: 2000, pv: 9800, amt: 2290},
        {name: 'Page D', uv: 2780, pv: 3908, amt: 2000},
        {name: 'Page E', uv: 1890, pv: 4800, amt: 2181},
        {name: 'Page F', uv: 2390, pv: 3800, amt: 2500},
        {name: 'Page G', uv: 3490, pv: 4300, amt: 2100},
  ];
    return (
        <Paper className={classes.paper}>
            {console.log(props.gymData.data)}
            <LineChart width={600} height={400} data={data}
                margin={{ top: 30, right: 50, left: 20, bottom: 20 }}>
                <XAxis dataKey="name" />
                <YAxis />
                <CartesianGrid strokeDasharray="3 3" />
                <Tooltip />
                <Legend height={36} wrapperStyle={{ top: 0, left: 25 }} />
                <Line type="monotone" dataKey={titleCase(props.gymData.workout.name)} stroke="#8884d8" />
            </LineChart>
        </Paper>
    );
}
